import React from "react";
import "./Whatnew.css";

const BoxColorExample = () => {
  return (
    <div className="container">
      {/* Left side text */}
      <div className="text-box">
        <h2>Colorful Box Model</h2>
        <p>
          Each part of this layout has its own color to represent how margin,
          border, and padding work in the box model.
        </p>
      </div>

      {/* Right side image */}
      <div className="image-box">
        <img
          src="assets/Hero.png"
          alt="Colorful Box Example"
        />
      </div>
</div>
  );
};

export default BoxColorExample;
